<!DOCTYPE html>
<html lang="zh-CN">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>可爱风贪吃蛇（流畅版 + 离线音频）</title>
  <style>
    :root{
      --bg:#fce7f3;
      --panel:#fdf2f8;
      --snake:#86efac;
      --snake-head:#4ade80;
      --food:#facc15;
      --text:#6b21a8;
      --muted:#a855f7;
      --accent:#ec4899;
    }
    *{box-sizing:border-box}
    html,body{height:100%;}
    body{
      margin:0; background:var(--bg); color:var(--text);
      font:500 15px/1.4 ui-sans-serif,system-ui,-apple-system,Segoe UI,Roboto,PingFang SC,Noto Sans SC,Helvetica Neue,Arial;
      display:flex; align-items:center; justify-content:center; padding:16px;
    }
    .wrap{width:min(960px,96vw); display:grid; grid-template-columns: 1fr 280px; gap:16px;}
    @media (max-width:860px){ .wrap{grid-template-columns:1fr} }
    .card{background:var(--panel); border:2px solid var(--accent); border-radius:14px; box-shadow:0 8px 24px rgba(0,0,0,.15);}
    .game{position:relative; aspect-ratio:1/1; overflow:hidden; display:flex; align-items:center; justify-content:center;}
    canvas{width:100%; height:100%; background:#fdf4ff;}
    .panel{padding:14px; display:flex; flex-direction:column; gap:12px}
    h1{margin:0; font-size:20px; color:var(--accent)}
    .stats{display:grid; grid-template-columns:repeat(2,1fr); gap:10px}
    .stat{background:#fce7f3; border:1px solid #f9a8d4; padding:10px 12px; border-radius:10px}
    .stat .lab{color:var(--muted); font-size:12px}
    .stat .val{font-weight:700; font-size:22px}
    .controls{display:grid; grid-template-columns:1fr 1fr; gap:10px}
    .btn{cursor:pointer; user-select:none; text-align:center; padding:10px 12px; border-radius:10px;
         background:#fbcfe8; border:2px solid #f472b6; color:var(--accent); font-weight:700}
    .btn:active{transform:translateY(1px)}
    .dpad{display:grid; grid-template-columns:64px 64px 64px; grid-template-rows:64px 64px 64px; gap:8px; justify-content:center}
    .dpad .empty{opacity:0; pointer-events:none}
    .dpad button{background:#fbcfe8; border:2px solid #f472b6; color:var(--accent); border-radius:10px; font-size:18px}
    .hint{color:var(--muted); font-size:13px}
    .hud{position:absolute; inset:0; display:grid; place-items:center; pointer-events:none}
    .hud .box{pointer-events:auto; background:rgba(255,240,245,.9); border:2px solid #f472b6; padding:16px 18px; border-radius:12px; text-align:center}
    .hud h2{margin:0 0 4px}
    .options{display:flex; flex-direction:column; gap:6px; font-size:14px}
  </style>
</head>
<body>
  <div class="wrap">
    <section class="card game">
      <canvas id="board" width="480" height="480" aria-label="贪吃蛇棋盘"></canvas>
      <div class="hud" id="hud">
        <div class="box">
          <h2 id="hudTitle">按空格开始</h2>
          <div class="hint">方向键移动 · 空格开始/暂停</div>
          <div style="margin-top:10px; display:flex; gap:8px; justify-content:center">
            <button class="btn" id="startBtn">开始</button>
            <button class="btn" id="restartBtn" style="display:none">重来</button>
          </div>
        </div>
      </div>
    </section>

    <aside class="card panel">
      <h1>可爱风贪吃蛇</h1>
      <div class="stats">
        <div class="stat"><div class="lab">分数</div><div class="val" id="score">0</div></div>
        <div class="stat"><div class="lab">速度</div><div class="val" id="speed">1</div></div>
      </div>
      <div class="controls">
        <button class="btn" id="toggleBtn">开始</button>
        <button class="btn" id="pauseBtn">暂停</button>
      </div>
      <div class="dpad">
        <button class="empty"></button>
        <button id="btnUp">▲</button>
        <button class="empty"></button>
        <button id="btnLeft">◀</button>
        <button class="empty"></button>
        <button id="btnRight">▶</button>
        <button class="empty"></button>
        <button id="btnDown">▼</button>
        <button class="empty"></button>
      </div>
      <div class="options">
        <label><input type="checkbox" id="bgmToggle" checked> 背景音乐</label>
        <label><input type="checkbox" id="sfxToggle" checked> 音效</label>
      </div>
      <div class="hint">规则：初始长度为 1。每吃 1 个金币，长度 +1、得分 +1。每累计 +5 长度，速度 +1。撞墙或撞到自己时游戏结束。</div>
    </aside>
  </div>

  </audio>

<script>
(() => {
  const GRID=20,CELL=24,CANVAS_SIZE=GRID*CELL;
  const board=document.getElementById('board'),ctx=board.getContext('2d');
  const scoreEl=document.getElementById('score'),speedEl=document.getElementById('speed');
  const toggleBtn=document.getElementById('toggleBtn'),pauseBtn=document.getElementById('pauseBtn');
  const hud=document.getElementById('hud'),hudTitle=document.getElementById('hudTitle');
  const startBtn=document.getElementById('startBtn'),restartBtn=document.getElementById('restartBtn');
  const btnUp=document.getElementById('btnUp'),btnDown=document.getElementById('btnDown');
  const btnLeft=document.getElementById('btnLeft'),btnRight=document.getElementById('btnRight');
  const bgm=document.getElementById('bgm'),sfx=document.getElementById('sfx');
  const bgmToggle=document.getElementById('bgmToggle'),sfxToggle=document.getElementById('sfxToggle');

  let snake,dir,nextDir,food,running,paused,score,speed;
  let lastTime=0; // rAF时间记录

  function resetGame(){
    snake=[{x:Math.floor(GRID/2),y:Math.floor(GRID/2)}];
    dir={x:1,y:0}; nextDir={...dir}; placeFood();
    score=0; speed=1; updateStats(); paused=true; running=false;
    showHUD("按空格开始"); draw();
  }
  function placeFood(){
    while(true){const fx=Math.floor(Math.random()*GRID),fy=Math.floor(Math.random()*GRID);
      if(!snake.some(s=>s.x===fx&&s.y===fy)){food={x:fx,y:fy};break;}
    }
  }
  function updateStats(){speed=1+Math.floor((snake.length-1)/5);scoreEl.textContent=score;speedEl.textContent=speed;}
  function intervalMs(){return Math.max(60,220-speed*20);}
  function start(){if(running)return;paused=false;running=true;hideHUD();toggleBtn.textContent="暂停";if(bgmToggle.checked){bgm.currentTime=0;bgm.play().catch(()=>{});} lastTime=0;requestAnimationFrame(gameLoop);}
  function pause(){if(!running)return;paused=true;toggleBtn.textContent="开始";showHUD("暂停中 · 按空格继续");bgm.pause();}
  function toggleStartPause(){if(!running)start();else if(!paused)pause();else{paused=false;hideHUD();toggleBtn.textContent="暂停";if(bgmToggle.checked){bgm.play().catch(()=>{});} requestAnimationFrame(gameLoop);}}
  function step(){dir=nextDir;const head={x:snake[0].x+dir.x,y:snake[0].y+dir.y};
    if(head.x<0||head.x>=GRID||head.y<0||head.y>=GRID)return gameOver();
    if(snake.some(seg=>seg.x===head.x&&seg.y===head.y))return gameOver();
    snake.unshift(head);
    if(head.x===food.x&&head.y===food.y){score+=1;if(sfxToggle.checked){sfx.currentTime=0;sfx.play().catch(()=>{});}placeFood();updateStats();}
    else{snake.pop();}
    draw();}
  function gameOver(){running=false;paused=true;toggleBtn.textContent="开始";showHUD("游戏结束 · 分数："+score);restartBtn.style.display="inline-block";bgm.pause();}
  function showHUD(t){hudTitle.textContent=t;hud.style.display="grid";}
  function hideHUD(){hud.style.display="none";restartBtn.style.display="none";}
  function draw(){ctx.clearRect(0,0,CANVAS_SIZE,CANVAS_SIZE);
    // 金币（圆形+描边）
    ctx.beginPath();ctx.arc(food.x*CELL+CELL/2,food.y*CELL+CELL/2,CELL/2.5,0,Math.PI*2);ctx.fillStyle="#FFD700";ctx.fill();ctx.strokeStyle="#DAA520";ctx.lineWidth=2;ctx.stroke();
    // 卡通蛇（方块+圆角+眼睛）
    snake.forEach((s,i)=>{const isHead=i===0;ctx.fillStyle=isHead?"#4ade80":"#86efac";ctx.beginPath();ctx.roundRect(s.x*CELL+2,s.y*CELL+2,CELL-4,CELL-4,6);ctx.fill();ctx.strokeStyle="#065f46";ctx.stroke();
      if(isHead){ctx.fillStyle="#000";ctx.beginPath();ctx.arc(s.x*CELL+CELL*0.35,s.y*CELL+CELL*0.35,3,0,Math.PI*2);ctx.arc(s.x*CELL+CELL*0.65,s.y*CELL+CELL*0.35,3,0,Math.PI*2);ctx.fill();}});
  }
  function gameLoop(timestamp){if(!running||paused)return;if(lastTime===0)lastTime=timestamp;const delta=timestamp-lastTime;if(delta>intervalMs()){step();lastTime=timestamp;}requestAnimationFrame(gameLoop);}
  function setDirection(nx,ny){if((nx===-dir.x&&ny===0)||(ny===-dir.y&&nx===0))return;nextDir={x:nx,y:ny};}
  window.addEventListener('keydown',e=>{if(['ArrowUp','ArrowDown','ArrowLeft','ArrowRight',' '].includes(e.key))e.preventDefault();
    switch(e.key){case'ArrowUp':setDirection(0,-1);break;case'ArrowDown':setDirection(0,1);break;case'ArrowLeft':setDirection(-1,0);break;case'ArrowRight':setDirection(1,0);break;case' ':toggleStartPause();break;}});
  toggleBtn.addEventListener('click',toggleStartPause);pauseBtn.addEventListener('click',()=>{running&&!paused?pause():start();});
  startBtn.addEventListener('click',start);restartBtn.addEventListener('click',()=>{resetGame();start();});
  btnUp.addEventListener('click',()=>setDirection(0,-1));btnDown.addEventListener('click',()=>setDirection(0,1));
  btnLeft.addEventListener('click',()=>setDirection(-1,0));btnRight.addEventListener('click',()=>setDirection(1,0));
  bgmToggle.addEventListener('change',()=>{if(!bgmToggle.checked){bgm.pause();}else if(running&&!paused){bgm.play().catch(()=>{});}});
  board.width=CANVAS_SIZE;board.height=CANVAS_SIZE;resetGame();
})();
</script>
